var Chatanyara=function(){"use strict";var Kushanku={performance:"object"!=typeof window.performance||window.performance,getNavigationTimings:function(){if(!this.performance||"object"!=typeof this.performance.timing)return!1;var data={},timing=this.performance.timing,navigationStart=timing.navigationStart;for(var key in timing)"number"==typeof timing[key]&&(data[key]=0===timing[key]?0:timing[key]-navigationStart);if("object"==typeof this.performance.navigation){var nav=this.performance.navigation;data.redirectCount=nav.redirectCount,data.navigationType=nav.type<3?["NAVIGATE","RELOAD","BACK_FORWARD"][nav.type]:nav.type}return data},getResourceTimings:function(){if(!this.performance||"function"!=typeof this.performance.getEntriesByType)return!1;var entries=JSON.parse(JSON.stringify(this.performance.getEntriesByType("resource")));return entries},getMemoryInfo:function(){if(!this.performance||"object"!=typeof this.performance.memory)return!1;var memory=JSON.parse(JSON.stringify(this.performance.memory));return memory}},Sai={parse:function(){return{url:window.location.pathname,userAgent:window.navigator.userAgent,navigation:Kushanku.getNavigationTimings(),resource:Kushanku.getResourceTimings(),memory:Kushanku.getMemoryInfo()}}};return Sai}();